export class CategoriesService {
    static categoriesUrl = `${process.env.REACT_APP_API_URL}/categories`;

    static getCategories() {
        return fetch(this.categoriesUrl)
            .then(res => res.json())
            .catch(err => {
                console.log(err);
            })
    }
}
